from typing import List


def find_max_consecutive_ones(nums: List[int]) -> int:
    if len(nums) == 1:
        return 1 if nums[0] == 1 else 0

    current = 0
    max_ = 0

    for i in nums:

        if i == 1:
            current += 1

        else:
            # max_ = max(max_, current)
            if current > max_:
                max_ = current
            current = 0

    return max(current, max_)


